Created attachment 245994 Example project showing the difference between javac reference apt and jdt apt
I am using annotations containing multiple attributes. In an AnnotationProcessor I create a copy of the class together with all ist annotations.
According to the APT specs the method AnnotationValue#toString() should:
"Returns a string representation of this value. This is returned in a form suitable for representing this value in the source code of an annotation." http://docs.oracle.com/javase/7/docs/api/javax/lang/model/element/AnnotationValue.html#toString()
In the standard javac processor this works as expected. However the jdt apt implementation is not really creating such text.
I created an example hello world application with an Annotation processor that creates and shows the differences between javac apt and eclipse jdt apt. The eclipse apt is run implicitly using a local lib/....jar of the processor. The javac apt is run using Junit-Run.
There are threee examples in that test project. The first Looks like this: @CreateCopy @TestAnnotation1( annotationValue = @SuppressWarnings("unused"), booleanValue = true, enumValue = RoundingMode.UP, intValue = 1, stringValue = "hello", typeValue = ArrayList.class) public class TestClass1 {
}
javac apt generates valid source code: @org.eclipse.apt.example.TestAnnotation1( annotationValue = @java.lang.SuppressWarnings({"unused"}), booleanValue = true, enumValue = java.math.RoundingMode.UP, intValue = 1, stringValue = "hello", typeValue = java.util.ArrayList.class ) public class TestClass1CopyByJavacProcessingEnvironment{
}
eclipse apt generates invalid source code: @org.eclipse.apt.example.TestAnnotation1( annotationValue = @java.lang.SuppressWarnings, booleanValue = true, enumValue = UP, intValue = 1, stringValue = hello, typeValue = java.util.ArrayList ) public class TestClass1CopyByIdeBuildProcessingEnvImpl{
}

I have tried using my provided patch https://git.eclipse.org/r/#/c/31774/ with Ivan's example project and the code generated through JDT APT is now correct:
@org.eclipse.apt.example.TestAnnotation1( annotationValue = @java.lang.SuppressWarnings(value = {"unused"}), booleanValue = true, enumValue = java.math.RoundingMode.UP, intValue = 1, stringValue = "hello", typeValue = java.util.ArrayList.class )
@org.eclipse.apt.example.TestAnnotation1( annotationValue = @java.lang.SuppressWarnings(value = {"unused"}), booleanValue = true, enumValue = java.math.RoundingMode.UP, intValue = 2147483647, stringValue = "hello", typeValue = java.util.Map.Entry.class )
@org.eclipse.apt.example.TestAnnotation2( annotationValues = {@java.lang.SuppressWarnings(value = {"unused1"}), @java.lang.SuppressWarnings(value = {"unused2"})}, booleanValues = {true, false, true}, enumValues = {java.math.RoundingMode.UP, java.math.RoundingMode.DOWN}, intValues = {0, 2147483647}, stringValues = {"hello", "hello"}, typeValues = {java.util.ArrayList.class, java.util.Map.Entry.class} )

If you have an annotation

@interface Test {
    String stringValue();
    char charValue();
}
@Test(stringValue = "I'm \"special\": \t\\\n", charValue = '\'')
class X {}

... then the stringValue() method returns an unescaped string. If you just put this into quotes, you'd get invalid source like this:

@Test(stringValue = "I'm "special": 	\
", charValue = ''')

We should have at least a test that verifies this works correctly.

here is a refined Version of my test annotation classes from an earlier post above. It uses quotes. javac does the following:

@CreateCopy
@TestAnnotation1(
    annotationValue = @SuppressWarnings("unused"),
    booleanValue = true,
    enumValue = RoundingMode.UP,
    intValue = 1,
    stringValue = "hello 'with' \"quotes\"",
    typeValue = ArrayList.class)
public class TestClass1 {

}

javac apt generates the following source code:
@org.eclipse.apt.example.TestAnnotation1(
  annotationValue = @java.lang.SuppressWarnings({"unused"}),
  booleanValue = true,
  enumValue = java.math.RoundingMode.UP,
  intValue = 1,
  stringValue = "hello 'with' \"quotes\"",
  typeValue = java.util.ArrayList.class
)
public class TestClass1CopyByJavacProcessingEnvironment{

}
